import React, { useState, useEffect, useCallback } from 'react';
import api from '../services/api';
import StoreDetailModal from '../components/StoreDetailModal';

function StoreListPage() {
  const [stores, setStores] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [filter, setFilter] = useState('');

  const [isViewModalOpen, setIsViewModalOpen] = useState(false);
  const [selectedStore, setSelectedStore] = useState(null);

  // Fetch store data
  const fetchStores = useCallback(async () => {
    try {
      setLoading(true);
      const response = await api.get('/stores');
      setStores(response.data.data);
    } catch (err) {
      console.error(err);
      setError('Failed to fetch stores.');
    } finally {
      setLoading(false);
    }
  }, []);

  useEffect(() => {
    fetchStores();
  }, [fetchStores]);

  const filteredStores = stores.filter(store =>
    (store.board_name || '').toLowerCase().includes(filter.toLowerCase()) ||
    (store.store_code || '').toLowerCase().includes(filter.toLowerCase()) ||
    (store.address || '').toLowerCase().includes(filter.toLowerCase())
  );

  const handleViewDetail = (store) => {
    setSelectedStore(store);
    setIsViewModalOpen(true);
  };

  if (loading) return <div className="loading">Loading stores...</div>;
  if (error) return <div className="error-message">{error}</div>;

  return (
    <div className="container">
      {/* Page header */}
      <div className="page-header">
        <h2 className="page-title">Store Management</h2>

        <div className="filter-bar">
          <select
            className="form-control filter-select"
            value={filter}
            onChange={(e) => setFilter(e.target.value)}
          >
            <option value="">All</option>
            <option value="Pharmacity">Pharmacity</option>
            <option value="Satrafood">Satrafoods</option>
          </select>

          <input
            type="text"
            placeholder="Search by name, code, or address..."
            value={filter}
            onChange={(e) => setFilter(e.target.value)}
            className="form-control filter-input"
          />
        </div>
      </div>

      {/* Table */}
      <div className="table-wrapper">
        <table className="table">
          <thead>
            <tr>
              <th>Store Chain</th>
              <th>Store Code</th>
              <th>Address</th>
              <th>District</th>
              <th>Status</th>
              <th className="text-center">Actions</th>
            </tr>
          </thead>
          <tbody>
            {filteredStores.length === 0 ? (
              <tr>
                <td colSpan="6" className="table-empty">
                  No stores found.
                </td>
              </tr>
            ) : (
              filteredStores.map((store) => (
                <tr key={store.id}>
                  <td>{store.board_name}</td>
                  <td>{store.store_code}</td>
                  <td>{store.address}</td>
                  <td>{store.district}</td>
                  <td>
                    <span
                      className={`status-badge ${store.is_active ? 'status-active' : 'status-inactive'}`}
                    >
                      {store.is_active ? 'Active' : 'Inactive'}
                    </span>
                  </td>
                  <td className="text-center">
                    <button
                      className="btn btn-outline btn-sm"
                      onClick={() => handleViewDetail(store)}
                    >
                      View
                    </button>
                  </td>
                </tr>
              ))
            )}
          </tbody>
        </table>
      </div>

      {/* Modal */}
      <StoreDetailModal
        isOpen={isViewModalOpen}
        onClose={() => setIsViewModalOpen(false)}
        store={selectedStore}
      />
    </div>
  );
}

export default StoreListPage;
